bout 15m after the first one finished. This timelapse also includes a recording of the surf and wind and a soundtrack. Haven't had enough time to learn how to use all the music composition and patterning software I purchased yet, I figure that's going to be a couple of months away and I have a new computer to build first.

Penang, Malaysia, Sep 4, 2020

I spent a few hours yesterday working on how to produce and rotate videos so they would maximize the screen real estate on Instagram. I thought I could simply produce the video in landscape mode and on output rotate it by 90% in DaVinci Resolve. If only it was that simple. In the end, I had to produce a 4k video with all the edits and soundtrack, output it, then use that footage in a new project, rotate it and resize to 1080 x 1350 so you'll have to rotate your phones to view it. Please let me know what you think.

Hope everybody is staying safe and sane.

